import React, { Component } from 'react';
import { Route, Link } from 'react-router-dom';

import './Shop.css';
import Earrings from './Earrings/Earrings';
import Necklace from './Necklace/Necklace';
import Rings from './Rings/Rings';
// import Home from './Home/Home';
// import Contact from './Contact/Contact';
// import NewPost from './NewPost/NewPost';
import FullInfo from './FullPost/FullPost';

class Blog extends Component {

    state = {

    }

    render () {
        return (
            <div className="Blog MainBlog">
                <nav className="navbar navbar-default mt-4">
                    <div className="container-fluid">
                        <div className="navbar-header">
                        <a className="navbar-brand blogTitle" href="#">John Bryce Fullstack 2018 Blog</a>
                        </div>
                        <ul className="nav navbar-nav">
                        <li><Link to="/">Earrings</Link></li>
                        <li><Link to="/posts">Necklace</Link></li>
                        <li><Link to="/contact">Rings</Link></li>
                        </ul>
                    </div>
                </nav>
                <hr></hr>

                <Route path="/" exact component={Earrings} /> 
                <Route path="/contact" exact component={Necklace} /> 
                <Route path="/rings" exact component={Rings} />
                <Route path="/fullPost/:id" component={FullInfo} />

                {/* routes :  npm install --save react-router react-router-dom */}
            </div>
        );
    }
}

export default Blog;
